import React from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';

function Roadmap() {
    var settings = {
        className: "",
        dots: true,
        infinite: true,
        slidesToShow: 1,
        slidesToScroll: 1,
        adaptiveHeight: true
    };

    return (
        <RoadmapSection>
            <div>
                <h2>Adaptive height</h2>
                <Slider {...settings}>  
                    <div>

                    </div>
                    <div>
                        <h3>2</h3>
                        <p>Hello</p>
                    </div>
                    <div>
                        <h3>3</h3>
                        <p>See ....</p>
                        <p>Height is adaptive</p>
                    </div>
                    <div>
                        <h3>4</h3>
                    </div>
                    <div>
                        <h3>5</h3>
                    </div>
                    <div>
                        <h3>6</h3>
                    </div>
                </Slider>
            </div>
        </RoadmapSection>    
    );
}

const RoadmapSection = styled.section`
    color: #fff;
    background: #141515;

    position: relative;
`



export default Roadmap;
